#include <stdio.h>

int w[11000];
int a[11000];
int b[11000];

main() {
    int n;
    int i, j;
    scanf("%d", &n);
    for(i = 0; i<n; i++) {
        scanf("%d", w+i);
    }
    for(i = n-1; i >=0; i--) {
        for(j=i+1; j <= n; j++) {
            if(j==n || w[j] > w[i]) {
                int nw = a[j]+1;
                if(nw > a[i]) a[i] = nw;
            }
            if(j == n || w[j] < w[i]) {
                int nw = b[j]+1;
                if(nw > b[i]) b[i] = nw;
            }
        }
    }
    int max = 0;
    for(i=0; i<n; i++) {
        /*printf("%d %d %d\n", w[i], a[i], b[i]);*/
        int nw = a[i] + b[i] - 1;
        if(nw > max) max = nw;
    }
    printf("%d\n", max);
}

using namespace std;
#include <algorithm>
#include <stdlib.h>
#include <bitset>
#include <vector>
#include <stdio.h>
#include <iostream>

#define MAX 11000
//#define MAX 11

bitset<MAX> seen;
int es[MAX][2];
int ei[MAX];
vector<int> topo;
int dd[MAX];
int uu[MAX];

void dfs(int i) {
    int j;
    if(seen[i]) return;
    seen[i] = 1;
    for(j = ei[i]; es[j][0] == i; j++) {
        dfs(es[j][1]);
    }
    topo.push_back(i);
}
int comp(const void* aa, const void* bb) {
    int* a = (int*) aa;
    int* b = (int*) bb;
    if(a[0] != b[0]) return a[0]-b[0];
    return a[1] - b[1];
}
bitset<MAX> bounds[MAX];

int l,r,u,d,a;
int glb(int x, int y) {
    int i;
    bitset<MAX> all = bounds[x] & bounds[y];
    for(i=0; i < topo.size(); i++) {
        if(all[topo[i]]) return topo[i];
    }
    printf("no glb for %u %u\n", x,y);
    cout << bounds[x] << endl;
    cout << bounds[y] << endl;
    cout << all << endl;
    exit(1);
}

main() {
    int i,j;
    scanf("%u%u%u%u%u", &l, &r, &u, &d, &a);
    for(i = 0; i < r; i++) {
        scanf("%u%u", &(es[i][0]), &(es[i][1]));
    }
    qsort(es, r, sizeof(es[0]), comp);
    /*
    for(i = 0; i < r; i++) {
        printf("%u %u\n", es[i][0], es[i][1]);
    }
    */
    j = 0;
    for(i = 0; i < r; i++) {
        while(j <= es[i][0]) {
            ei[j] = i;
            j++;
        }
    }
    for(i=1; i<= l; i++) dfs(i);
    for(i=1; i<= l; i++) bounds[i][i] = 1;
    reverse(topo.begin(), topo.end());
    for(i=0; i < topo.size(); i++) {
        int k = topo[i];
        for(j = ei[k]; es[j][0] == k; j++) {
            bounds[es[j][1]] |= bounds[es[j][0]];
        }
        //cout << k << " " << bounds[k] << endl;
    }
    reverse(topo.begin(), topo.end());
    for(i=1; i<= u; i++) scanf("%u", uu+i);
    for(i=1; i<= d; i++) scanf("%u", dd+i);
    for(i=1; i<= a; i++) {
        char s[1000];
        int x,y;
        scanf("%u %s %u", &x, s, &y);
        int g = glb(uu[x],dd[y]);
        if(s[0] == 'w') dd[y] = g;
        else uu[x] = g;
        printf("%u\n", g);
    }
}

#define deb 0
#include <stdlib.h>
#include <algorithm>
#include <stdio.h>
#include <queue>
#include <set>
#include <string>
using namespace std;
typedef string board;

#define B(b,i,j) b[((i)*4)+(j)]

typedef struct {
    board b;
    int moves;
} mboard;

int bad(board b) {
    int j;
    for(int i = 0; i < 3; i++) for(j = 0; j < 4; j++) {
        if(B(b,i,j) == 'R' || B(b,i,j) == 'B')
            if(B(b,i+1,j) == 'R' || B(b,i+1,j) == 'B')
                return 1;
    }
    for(int i = 0; i < 4; i++) for(j = 0; j < 3; j++) {
        if(B(b,i,j) == 'R' || B(b,i,j) == 'B')
            if(B(b,i,j+1) == 'R' || B(b,i,j+1) == 'B')
                return 1;
    }
    return 0;
}

queue<mboard> q;
set<board> seen;

void print(board b) {
    for(int i = 0; i < 4; i++) {
    for(int j = 0; j < 4; j++) {
        printf("%c", B(b,i,j));
    }
        printf("\n");
    }
        printf("\n");
}

void attempt(board b, int moves) {
    if(seen.count(b) > 0) return;
    if(deb) puts("not seen");
    seen.insert(b);
    int s = seen.size();
    if(deb) if((s%1000) == 0) printf("seen: %u q: %u\n", seen.size(), q.size());
    if(deb) print(b);
    if(bad(b)) return;
    if(deb) puts("not bad");
    mboard m;
    m.b = b;
    m.moves = moves;
    q.push(m);
    if(deb) puts("pushed");
}

int badd(int i, int di) {
    if(i+di >3) return 1;
    if(i+di <0) return 1;
    return 0;
}
void move(board b, int i, int j, int di, int dj, int moves) {
    if(badd(i,di*2)) return;
    if(badd(j,dj*2)) return;
    if(B(b,i,j) == '.') return;
    if(B(b,i+di,j+dj) == '.') return;
    if(B(b,i+di+di,j+dj+dj) != '.') return;
    B(b,i+di+di,j+dj+dj) = B(b,i,j);
    B(b,i,j) = '.';
    attempt(b, moves+1);
}
void move2(board b, int i, int j, int di, int dj, int moves) {
    if(badd(i,di*3)) return;
    if(badd(j,dj*3)) return;
    if(B(b,i,j) == '.') return;
    if(B(b,i+di,j+dj) == '.') return;
    if(B(b,i+di+di,j+dj+dj) == '.') return;
    if(B(b,i+di+di+di,j+dj+dj+dj) != '.') return;
    B(b,i+di+di+di,j+dj+dj+dj) = B(b,i,j);
    B(b,i,j) = '.';
    attempt(b, moves+1);
}

int main() {
    int i,j;
    int pos=0;
    int mb=0;

    char line[100];

    board b = "................";
    for(i=0; i<4; i++) {
        gets(line);
        for(j=0; j<4; j++) B(b,i,j) = line[j];
    }
    attempt(b, 0);
    while(q.size() > 0) {
        pos++;
        mboard m = q.front();
        q.pop();
        board b = m.b;
        if(deb) if(m.moves > mb) {
            mb = m.moves;
            printf("moves: %u\n", mb);
        }
        if(B(b,0,0) == 'R') {
            printf("%u\n", m.moves);
            break;
        }
        for(i=0; i < 4; i++) for(j=0; j<4; j++) {
            move(b, i,j,0,1, m.moves);
            move(b, i,j,0,-1, m.moves);
            move(b, i,j,1,0, m.moves);
            move(b, i,j,-1,0, m.moves);
            move2(b, i,j,0,1, m.moves);
            move2(b, i,j,0,-1, m.moves);
            move2(b, i,j,1,0, m.moves);
            move2(b, i,j,-1,0, m.moves);
        }
    }
    if(deb) printf("done %u\n" , pos);
}

#include <stdio.h>

int M[110];
int P[1100000];

main() {
    int i,j,a,b,c,p;
    for(i = 0; i < 110; i++) M[i] = i;
    scanf("%u %u %u", &a, &b, &c);
    for(i = 0; i < a; i++) P[i] = 1;
    while(b--) {
        scanf("%u %u", &i, &j);
        M[i] = j;
    }
    p = 0;
    while(c--) {
        scanf("%u", &i);
        P[p] += i;
        if(P[p] > 100) P[p] = 100;
        P[p] = M[P[p]];
        if(P[p] == 100) break;
        p++;
        p %= a;
    }
    for(i = 0; i < a; i++)
        printf("Position of player %u is %u.\n", i+1, P[i]);
}

#include <cmath>
#include <cstdio>
#include <iostream>
#include <vector>
using namespace std;

void add_tri(double x1, double y1, double x2, double y2,
             double* tot_ar, double* wx) {
  double ar = x1*y2 - x2*y1;
  *tot_ar += ar;
  *wx += ar * (x1+x2)/3.0;
}

typedef vector<int> VI;

main() {
  int n;
  cin >> n;
  VI x(n), y(n);
  for (int i = 0; i < n; i++) cin >> x[i] >> y[i];
  x.push_back(x[0]); y.push_back(y[0]);
  double tar = 0.0, tx = 0.0, bar = 0.0, bx = 0.0;
  for (int i = 0; i < n; i++) {
    if (y[i] >= 0 && y[i+1] >= 0) {
      add_tri(x[i], y[i], x[i+1], y[i+1], &tar, &tx);
    } else if (y[i] <= 0 && y[i+1] <= 0) {
      add_tri(x[i], y[i], x[i+1], y[i+1], &bar, &bx);
    } else {
      double mx = y[i]*(double)(x[i+1]-x[i])/(y[i]-y[i+1]) + x[i];
      add_tri(x[i], y[i], mx, 0.0, y[i] > 0 ? &tar : &bar,
                                   y[i] > 0 ? &tx : &bx);
      add_tri(mx, 0.0, x[i+1], y[i+1], y[i+1] > 0 ? &tar : &bar,
                                       y[i+1] > 0 ? &tx : &bx);
    }
  }
  tx /= tar; bx /= bar;
  if (fabs(tx-bx) < 1e-6) {
    printf("Balanced.\n");
  } else if (tx < bx) {
    printf("CE is aft of CLR by %.02lf units.\n", bx-tx);
  } else {
    printf("CE is forward of CLR by %.02lf units.\n", tx-bx);
  }
}
